{
  "$schema": "https://schema.tauri.app/config/2",
  "productName": "Arnis",
  "version": "2.1.3",
  "identifier": "com.louisdev.arnis",
  "build": {
    "frontendDist": "gui-src"
  },
  "app": {
    "withGlobalTauri": true,
    "windows": [
      {
        "title": "Arnis",
        "width": 1000,
        "height": 650,
        "resizable": false,
        "transparent": true,
        "center": true,
        "theme": "Dark"
      }
    ],
    "security": {
      "csp": null
    }
  },
  "bundle": {
    "active": true,
    "targets": "all",
    "icon": [
      "icons/32x32.png",
      "icons/128x128.png",
      "icons/128x128@2x.png",
      "icons/icon.icns",
      "icons/icon.ico"
    ],
    "windows": {
      "webviewInstallMode": {
        "type": "embedBootstrapper"
      }
    }
  }
}
